'use strict';
class OpenPositionManagerOnDeleteAction {
    listener;
    openPositionInfo;
    static create(openPositionInfo) {
        let result;
        result = new OpenPositionManagerOnDeleteAction();
        result.openPositionInfo = openPositionInfo;
        return result;
    }
    setListener(listener) {
        this.listener = listener;
    }
    execute() {
        this.listener.onDelete(this.openPositionInfo);
    }
}
module.exports = OpenPositionManagerOnDeleteAction
